<script>
(function(){
  const here = (location.pathname.split('/').pop() || 'index.html').toLowerCase();
  // Highlight active link (if present)
  document.querySelectorAll('.left-links a').forEach(a=>{
    const href = (a.getAttribute('href')||'').toLowerCase();
    if(href === here) a.classList.add('active');
  });
  // Set dropdown default
  const sel = document.getElementById('suite-select');
  if(sel){
    const isRobyn = here.includes('robyn');
    sel.value = isRobyn ? 'summary_output_robyn.html' : 'index.html';
    sel.addEventListener('change', (e)=>{
      const v = e.target.value;
      if(v) location.href = v;
    });
  }
})();
</script>
